count = 0

def rev(n):
    return int(str(n)[::-1])

def is_pal(s):
    s_str = str(s)
    return s_str == s_str[::-1]

for n in range(1, 1001):
    s = n * n + rev(n)
    if is_pal(s):
        count += 1

print(count)
